result:
.more {
  height: 100vh;
  color: #feffff;
  overflow: hidden;
  background-image: url('../../assets/yingzhi/bg_img.png');
  background-size: 100% 100%;
}
.header {
  height: 8%;
  width: 100%;
  margin-bottom: 5px;
  background-image: url("../../assets/yingzhi/topback.png");
  background-repeat: no-repeat;
  background-size: 100%;
}
.header_text {
  width: 30%;
  text-align: center;
  color: #fff;
  line-height: 50px;
  font-size: 20px;
  letter-spacing: 10px;
  float: left;
  position: absolute;
  left: 50%;
  top: 0%;
  margin-left: -15%;
}
.daoy {
  position: relative;
  left: 20px;
  top: 5px;
  z-index: 1000000;
}
/* 主体 */
.body {
  width: 32%;
  height: 90%;
  float: left;
  margin-right: 1.5%;
}
.ditu {
  height: 89.5%;
  background: rgba(20, 23, 71, 0.5);
  filter: progid:DXImageTransform.Microsoft.gradient(startcolorstr=#7F141747,endcolorstr=#7F141747);
  border-radius: 10px;
}
.li_header {
  width: 100%;
  height: 30px;
  color: yellow;
  text-align: center;
  font-weight: 800;
  line-height: 30px;
  font-size: 15px;
  font-family: "宋体";
}
.li_body {
  width: 90%;
  height: 80%;
  margin-left: 5%;
  margin-top: -5px;
}
/* 主体 */
.body_li1 {
  width: 90%;
  height: 38%;
  margin-left: 5%;
  background: rgba(31, 58, 137, 0.5);
  filter: progid:DXImageTransform.Microsoft.gradient(startcolorstr=#7F1f3a89,endcolorstr=#7F1f3a89);
  border: 1px solid #00a0e9;
}
.body_li2 {
  width: 90%;
  height: 30%;
  margin-left: 5%;
  background: rgba(31, 58, 137, 0.5);
  filter: progid:DXImageTransform.Microsoft.gradient(startcolorstr=#7F1f3a89,endcolorstr=#7F1f3a89);
  margin-top: 1%;
  border: 1px solid #00a0e9;
}
/* tab切换 */
.li_tab {
  border-radius: 5px;
  border: 1px solid #15c9f9;
  overflow: hidden;
  z-index: 10000000000;
  position: relative;
  left: 70%;
}
.li_tab div {
  float: right;
  width: 50%;
  padding: 3px 10px;
  font-size: 10px;
  background: #223a8b;
  text-align: center;
  cursor: pointer;
}
.li_tab .z {
  background: #141848;
}
.li_jin {
  float: left;
  background: #223a8b;
  height: 0;
  z-index: 100;
  margin-top: -2%;
  margin-left: 15%;
  font-size: 5px;
}
.li_jin div {
  font-size: 10px;
}
.wend {
  position: relative;
  left: 20px;
  top: 20px;
  font-size: 30px;
  height: 0px;
  font-weight: 600;
}
.riqi {
  height: 0px;
  position: relative;
  right: 30px;
  top: 20px;
  font-weight: 500;
}
.kongqi {
  height: 0px;
  position: relative;
  right: 50%;
  top: 45%;
  font-weight: 500;
  font-size: 15px;
}
.kongqi p {
  font-size: 10px;
}

.dian {
  width: 100px;
  position: relative;
  top: -90%;
  left: 5%;
  z-index: 9999;
  cursor: pointer;
}
.hengd {
  width: 90px;
  height: 25px;
  border-radius: 0 100px 100px 0;
  margin-bottom: 10px;
  margin-top: 10px;
  color: #fff;
  font-size: 13px;
  line-height: 25px;
  text-align: right;
  padding-right: 10px;
  z-index: 9999;
  background: #1e3b88;
}
.hengd div {
  padding-right: 20px;
}
.hengd2 div {
  background: rgba(00, 00, 00, 0.5);
  width: 220%;
  height: 25px;
  margin-top: -25px;
  z-index: 9999;
  border-radius: 0 100px 100px 0;
  display: block;
  animation: dong1 0.5s;
}
@keyframes dong1 {
  0% {
    width: 10%;
    color: #000;
  }
  100% {
    width: 220%;
    color: #fff;
  }
}
.hengd1 div {
  display: none;
}
/* 地图图表 */
.tubiao {
  height: 0;
  position: relative;
  left: 6.5%;
  z-index: 1000;
}
